function App() {
    function add(a,b) {
        let sum = a+b;
        return sum;
    }
    function sub(a,b) {
        let sub = a-b;
        return sub;
    }
    function multy(a,b) {
        let multy = a*b;
        return multy;
    }
    function div(a,b) {
        let div = a/b;
        return div;
    }
    return (
        <ol>
        <li>Addition of These Two Number is {add(40,20)} </li>
        <li>Substration of These Two Number is {sub(40,20)} </li>
        <li>Multiply of These Two Number is {multy(4,4)} </li>
        <li>Divide of These Two Number is {div(8,2)}</li>
    </ol>
    );
}
